DROP TABLE IF EXISTS `cn_regions`;

CREATE TABLE `cn_regions` (
	`id` INT UNSIGNED NOT NULL PRIMARY KEY AUTO_INCREMENT,
	`province_code` INT UNSIGNED NOT NULL,
	`province_name` VARCHAR(15) NOT NULL,
	`city_code` INT UNSIGNED NOT NULL,
	`city_name` VARCHAR(15) NOT NULL,
	`district_code` INT UNSIGNED DEFAULT NULL,
	`district_name` VARCHAR(15) DEFAULT NULL,
	KEY `region_index` (`province_code`, `city_code`)
) ENGINE=INNODB DEFAULT CHARSET=UTF8;

